var panzoom = require('panzoom');
export default function() {
	console.log('ddd')




	document.addEventListener('DOMContentLoaded', function() {
		console.log('aaaa')
		var element = document.getElementById('irkutsk');
		if (element) {
			panzoom(element, {
				smoothScroll: false,
				bounds: true,
				boundsPadding: 0.1,
				maxZoom: 4,
				minZoom: 0.8
			});
		}
	});
}
